  templateUrl: './chevron.component.html',
})
export class SkyChevronComponent {
  @Output()
  public directionChange = new EventEmitter<string>();

  @Input()
  public direction = 'up';

  @Input()
  public disabled = false;

  public chevronClick(event: Event): void {
