  border-style: solid;
  border-width: 3px 0 0 0;
  display: inline-block;
  height: 10px;
  position: absolute;
  top: 10px;
  transition: transform $sky-transition-time-medium,
    left $sky-transition-time-medium;
  vertical-align: top;
  width: 10px;
}

.sky-chevron-up {
  .sky-chevron-left {
    left: 7px;
    transform: rotate(-45deg);
  }

  .sky-chevron-right {
    left: 7px;
    transform: rotate(45deg);
  }
}

.sky-chevron-down {
  .sky-chevron-left {
    left: 2px;
    transform: rotate(45deg);
  }

  .sky-chevron-right {
    left: 12px;
    transform: rotate(-45deg);
  }
}

