    border-radius: 1px 0 0 1px;
  }

  .sky-chevron-right {
    border-radius: 0 1px 1px 0;
  }

  .sky-chevron-left {
    left: 4px;
  }

  .sky-chevron-right {
    left: 10.5px;
  }
}

